        {
            name :"About",
            link : "/about"
        },
        {
            name : "login",
            link : "/login"
        }
        ]

        return routes
    }

    componentDidMount(){
        this.setState({
            navItems : this.getRoutes()
        },()=>{console.log(this.state.navItems)})

    }
    render() {

        return (
            <div>

                <Navbar navItems={this.state.navItems} />
                {/* <Body navItems={this.state.navItems} /> */}
            </div>
        )
    }
}

export default Layout
